CREATE TABLE jednostki
( 
    kod varchar(6), 
    okres varchar(2), 
    czlon1 varchar(70), 
    czlon2 varchar(110), 
    nazwa varchar(110), 
    skrot varchar(35), 
    start varchar(2),
    constraint jednostki_pkey primary key (kod)
)
WITH (
  OIDS=FALSE
);
ALTER TABLE jednostki OWNER TO milosz;

